import React from "react";

class Contactinfo extends React.Component {

    constructor() {
        super();
        this.state = {
            address : '',
            email : '',
            contact : ''
        }
    }


    render() {
        return(

            <div>
                <h3>Create Brand</h3>
                <hr />
                <div >
                    <div className="form-group">
                        <label for="exampleInputEmail1">Address</label>
                        <input type="text" className="form-control" value={this.state.address} placeholder="Enter brand name" onChange={changeInput} />
                    </div>

                    <div className="form-group">
                        <label for="exampleInputEmail1">Email Id</label>
                        <input type="text" className="form-control" value={this.state.email} placeholder="Enter brand name" onChange={changeName} />
                    </div>

                    <div className="form-group">
                        <label for="exampleInputEmail1">Contact Number</label>
                        <input type="text" className="form-control" value={this.state.contact} placeholder="Enter brand name" onChange={changeName} />
                    </div>
                    <button type="submit" onClick={submit} className="btn btn-primary">Submit</button>
                </div>
            </div>
        )

    }
}


export default Contactinfo;
